		"id_str": "1112793276225028098",
		"full_text": "I’m annoyed that this article doesn’t acknowledge Halle Berry in/as Catwoman (2004). Say what you will about it, but it happened. I’m beginning to suspect that a lot of contemporary black film writing is trying to erase particular types of black film texts from the conversation. https://t.co/DOQgGRroye",
